import React from 'react';

function Button(props) {
  console.log(props.backgroundColor)
  return (
    <button
      style={{
        backgroundColor: props.backgroundColor,
        color: props.color,
        fontSize: props.fontSize,
        padding: '15px 32px',
        margin: '4px 2px',
        cursor: 'pointer',
        textAlign: props.textAlign === 'center' ? 'center' : props.textAlign,
        textDecoration: 'none',
        border: 'black solid 2px',
        borderRadius: props.borderRadius === 'center' ? 'center' : props.textAlign
      }}
    >
      {props.backgroundColor}
    </button>
  );
}

Button.defaultProps = {
  backgroundColor: 'transparent',
  color: 'black',
  fontSize: '16px',
  padding: '1rem',
  marginTop: '6px',
  cursor: 'pointer',
  textAlign: 'center',
  textDecoration: 'none',
  border: 'none',
  borderBottom: 'solid black 1px',
}

export default Button;
